import React, { useState } from "react";
import "./App.css";
import Nav from "./components/Nav";
import Footer from "./components/Footer";
import AccountBox from "./components/accountBox";
import {
  ApolloClient,
  InMemoryCache,
  ApolloProvider,
  createHttpLink,
} from "@apollo/client";

import { setContext } from "@apollo/client/link/context";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import styled from "styled-components";
import { AppContainer } from "./components/accountBox/Common.js";
import { io } from "socket.io-client";
import ExploreCard from "./components/accountBox/ExploreCard";
import About from "./components/accountBox/About";
import ProfileCard from "./components/accountBox/ProfileCard";
import ProjectForm from "./components/accountBox/ProjectForm";

const httpLink = createHttpLink({
  uri: "/graphql",
});
const authLink = setContext((_, { headers }) => {
  // get the authentication token from local storage if it exists
  const token = localStorage.getItem("id_token");
  // return the headers to the context so httpLink can read them
  return {
    headers: {
      ...headers,
      authorization: token ? `Bearer ${token}` : "",
    },
  };
});
const client = new ApolloClient({
  // Set up our client to execute the `authLink` middleware prior to making the request to our GraphQL API
  link: authLink.concat(httpLink),
  cache: new InMemoryCache(),
});

const URL =
  process.env.NODE_ENV === "production" ? undefined : "http://localhost:4000";
export const socket = io(URL, {
  autoConnect: false,
});
function App() {
  const [input, setInput] = useState("");
  const handleChange = (e) => {
    setInput(e.target.value);
  };
  function chatSend(event) {
    event.preventDefault();
    console.log("submitted:", input);
    if (input) {
      socket.emit("chat message", input);
      setInput("");
    }
  }
  //  this is for the profile cards
  const [cards, setCards] = useState([
    {
      title: "What I learned from my visit to The Upside Down",
      content:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam.",
      author: "Nancy Wheeler",
    },
  ]);
  return (
    <ApolloProvider client={client}>
      <Router>
        <Routes>
          <Route
            exact
            path="/"
            element={
              <>
                <Nav />
                <AppContainer>
                  <AccountBox />
                </AppContainer>
                <Footer />
              </>
            }
          />
          <Route
            path="/explore"
            element={
              <>
                <Nav />
                <ExploreCard
                  key={ExploreCard.id}
                  projectTitle={ExploreCard.projectTitle}
                  projectAuthor={ExploreCard.projectAuthor}
                />

                <Footer />
              </>
            }
          />
          <Route
            path="/about"
            element={
              <>
                <Nav />
                <About />
                <Footer />
              </>
            }
          />
          <Route
            path="/profile"
            element={
              <>
                <Nav />
                <ProfileCard
                  key={ProfileCard.id}
                  projectTitle={ProfileCard.projectTitle}
                  projectDescription={ProfileCard.projectDescription}
                />
                <Footer />
              </>
            }
          />
          <Route
            path="/projectform"
            element={
              <>
                <Nav />
                <ProjectForm
                  key={ProjectForm.id}
                  projectTitle={ProjectForm.projectTitle}
                  projectDescription={ProjectForm.projectDescription}
                />
                <Footer />
              </>
            }
          />
          <Route
            path={"/projects/" + ProjectForm.projectTitle}
            element={
              <>
                <Nav />
                <Footer />
              </>
            }
          />
        </Routes>
      </Router>
    </ApolloProvider>
  );
}
export default App;
